import java.io.*;
import java.util.*;

public class Main {
    static int N, M;
    static int[] a, b, low, num, st;
    static int timer;
    static List<Integer>[] g;

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        PrintWriter pw = new PrintWriter(System.out);
        StringTokenizer st = new StringTokenizer(br.readLine());
        N = Integer.parseInt(st.nextToken());
        M = Integer.parseInt(st.nextToken());
        a = new int[M];
        b = new int[M];
        low = new int[N];
        num = new int[N];
        st = new int[N];
        g = new List[N];
        for (int i = 0; i < N; i++) {
            g[i] = new ArrayList<>();
        }
        for (int i = 0; i < M; i++) {
            st = new StringTokenizer(br.readLine());
            a[i] = Integer.parseInt(st.nextToken()) - 1;
            b[i] = Integer.parseInt(st.nextToken()) - 1;
            g[a[i]].add(i);
            g[b[i]].add(i);
        }
        timer = 0;
        int ans = 0;
        for (int i = 0; i < N; i++) {
            if (num[i] == 0) {
                dfs(i, -1);
            }
        }
        for (int i = 0; i < M; i++) {
            if (low[a[i]] < num[a[i]] && low[b[i]] < num[b[i]]) {
                ans++;
            }
        }
        pw.println(ans);
        pw.close();
    }

    static void dfs(int u, int p) {
        st[++timer] = u;
        num[u] = low[u] = timer;
        for (int i : g[u]) {
            int v = (i == a[u] ? b[u] : a[u]);
            if (num[v] == 0) {
                dfs(v, i);
                low[u] = Math.min(low[u], low[v]);
                if (low[v] > num[u]) {
                    ans++;
                }
            } else if (v != p) {
                low[u] = Math.min(low[u], num[v]);
            }
        }
        timer--;
    }
}
